      },
    },
  )
).json();

const sum = response.reduce((acc, item) => acc + item.totalSeconds, 0);
const sumHr = sum / 3600;
const sumMin = sum / 60;

const hourRate = await vars.hour_rate;


const roundedHours = Math.round((sumHr)*100)/100;
const finalValue = Math.round(roundedHours * hourRate * 100)/100;

return {
  netValue: finalValue,
  description: `Tmetric report: from ${startDate} to ${endDate}
